import React from 'react';
import { makeStyles } from '@material-ui/core/styles';

import AppBar from '@material-ui/core/AppBar';
import Toolbar from '@material-ui/core/Toolbar';
import Link from '@material-ui/core/Link';
import Button from '@material-ui/core/Button';


const useStyles = makeStyles((theme) => ({
    root: {
        background: 'linear-gradient(#ac1c13, #bf4342)',
    },
  menuButton: {
    marginRight: theme.spacing(2),
  },
  linkBrand: {
    flexGrow: 1,
    fontFamily: '-apple-system-body, BlinkMacSystemFont, sans-serif',
    fontWeight: '100',
    [theme.breakpoints.down('xs')]: {
      display: 'none',
    }
  },
  linkBrandSmall: {
    display: 'none',
    flexGrow: 1,
    [theme.breakpoints.down('xs')]: {
      display: 'inline-block',
    }
  },
  secondaryButton: {
    marginRight: theme.spacing(2),
  },
  drawerContainer: {
    width: 256,
  }
}
));

export default function Component(props) {
  const classes = useStyles();

  return (
    <AppBar position="static" className={classes.root}>
    <Toolbar>
        <Link href="#" variant="h5" color="inherit" underline="none" className={classes.linkBrand}>
        iHeartRate
        </Link>
        <Button color="inherit" className={classes.secondaryButton}>Sign in</Button>
    </Toolbar>
    </AppBar>
  );
}
